'',
'function render_region(p_region              in apex_plugin.t_region,',
'                       p_plugin              in apex_plugin.t_plugin,',
'                       p_is_printer_friendly in boolean)',
'return apex_plugin.t_region_render_result is',
'	-- plugin attributes',
'	l_result  	apex_plugin.t_region_render_result;',
'',
'	l_attr_01		p_region.attribute_01%type := p_region.attribute_01;',
'',
'	l_iters2submit apex_application_page_regions.ajax_items_to_submit%type := apex_plugin_util.page_item_names_to_jquery(p_region.ajax_items_to_submit);',
'',
'	-- other vars',
'	l_region_id varchar2(200);',
'begin',
'	-- debug',
'	if apex_application.g_debug then',
'		apex_plugin_util.debug_region(',
'			p_plugin => p_plugin,',
'			p_region => p_region',
'		);',
'	end if;',
'',
'	-- set vars',
'	l_region_id := apex_escape.html_attribute(p_region.static_id);',
'	',
'	-- escape input',
'',
'	l_attr_01  := apex_escape.html(l_attr_01);',
'	',
'  -- write region html',
'  -- depending on the selected Region Style, diffent HTML will be generated',
'',
'    htp.p(''<div id="'' || l_region_id || ''-p" class="container"></div>'');',
'	',
'	-- add CSS files',
'	apex_css.add_file(',
'		p_name           => ''CustomStyle'',',
'		p_directory      => p_plugin.file_prefix,',
'		p_version        => NULL,',
'		p_skip_extension => FALSE,',
'		p_media_query	 => NULL,',
'		p_key         	 => ''CustomStyle''',
'	);',
'',
'	apex_css.add_file(',
'		p_name           => ''bootstrap.min'',',
'		p_directory      => p_plugin.file_prefix,',
'		p_version        => NULL,',
'		p_skip_extension => FALSE,',
'		p_media_query	 => NULL,',
'		p_key         	 => ''bootstrapcss''',
'	);',
'',
'    apex_css.add_file(',
'		p_name           => ''font-awesome'',',
'		p_directory      => p_plugin.file_prefix,',
'		p_version        => NULL,',
'		p_skip_extension => FALSE,',
'		p_media_query	 => NULL,',
'		p_key         	 => ''font-awesome''',
'	);',
'',
'	-- add JavaScript files',
'	apex_javascript.add_library (',
'		p_name                    => ''bootstrap.min'',',
'		p_directory               => p_plugin.file_prefix,',
'		p_version                 => NULL,',
'		p_check_to_add_minified   => FALSE,',
'		p_skip_extension          => FALSE,',
'		p_ie_condition            => NULL,',
'		p_requirejs_module        => NULL,',
'		p_requirejs_js_expression => NULL,',
'		p_requirejs_required      => FALSE,',
'		p_key                     => ''BootstrapScript''',
'	);',
'',
'    apex_javascript.add_library (',
'		p_name                    => ''jquery.min'',',
'		p_directory               => p_plugin.file_prefix,',
'		p_version                 => NULL,',
'		p_check_to_add_minified   => FALSE,',
'		p_skip_extension          => FALSE,',
'		p_ie_condition            => NULL,',
'		p_requirejs_module        => NULL,',
'		p_requirejs_js_expression => NULL,',
