'		 || apex_javascript.add_value( l_attr_04, true )',
'         */                         ',
'     || '');'' );',
'											',
'    return l_result;',
'end;',
'',
'',
'--Customize Function for data process',
'function sql_to_sys_refcursor (',
'    p_in_sql_statement   clob,',
'    p_in_binds sys.dbms_sql.varchar2_table',
') return sys_refcursor as',
'    l_cursor_name   binary_integer;',
'    l_rows_execute  binary_integer;',
'    l_binds         varchar2(100);',
'    l_ref_cursor    sys_refcursor;',
'begin',
'    l_cursor_name         := dbms_sql.open_cursor;',
'',
'    dbms_sql.parse(l_cursor_name,p_in_sql_statement,dbms_sql.native);',
'',
'    if p_in_binds.count > 0 then',
'        for i in 1..p_in_binds.count',
'        loop',
'            l_binds   := ltrim(p_in_binds(i),'':'');',
'            dbms_sql.bind_variable(l_cursor_name,l_binds,v(l_binds));',
'        end loop;',
'    end if;',
'',
'    l_rows_execute := dbms_sql.execute(l_cursor_name);',
'    l_ref_cursor   := dbms_sql.to_refcursor(l_cursor_name);',
'',
'    return l_ref_cursor;',
'exception when others then',
'        if dbms_sql.is_open(l_cursor_name) then',
'            dbms_sql.close_cursor(l_cursor_name);',
'        end if;',
'        raise;',
'end;',
'',
'--AJAX Procedure/Function Name',
'function ajax_region (',
'  p_region in apex_plugin.t_region,',
'  p_plugin in apex_plugin.t_plugin )',
'  return apex_plugin.t_region_ajax_result',
'as',
'    l_result      apex_plugin.t_region_ajax_result;',
'    l_ref_cursor  sys_refcursor;',
'    l_bind_names  sys.dbms_sql.varchar2_table;',
'',
'begin',
'',
'    /* undocumented function of apex for get all bindings */',
'    l_bind_names   := wwv_flow_utilities.get_binds(p_region.source);',
'',
'    /* execute binding*/',
'    l_ref_cursor  := sql_to_sys_refcursor(rtrim(p_region.source,'';'' ), l_bind_names);',
'',
'    /* create json */',
'    apex_json.open_object;',
'    apex_json.write(''row'',l_ref_cursor);',
'    apex_json.close_object;',
'',
'   --apex_util.json_from_sql(sqlq  => rtrim(p_region.source,'';''));',
'',
'  return l_result;',
'end ajax_region;'))
